import React from 'react';
import logo from './logo.svg';
import './App.css';
import * as ReactDOM from "react-dom/client";

import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import Root from './routes/root';


const router = createBrowserRouter([
  {
    path: "/",
    element: <Root/>
  },
]);


function App() {
  return (
    <React.StrictMode>


    <RouterProvider router={router} />
  </React.StrictMode>
  );
}

export default App;
